                    "details": "  钧瓷为宋代钧、汝、官、哥、定五大名瓷之一，始创于唐，盛于北宋，其独特的窑变技艺在中国陶瓷烧制工艺中自成一格。北宋徽宗时期，官府在今河南省禹州市区东北部设置官窑，为皇宫烧制贡瓷。因窑址邻近古代春秋战国的钧台，故名为“钧台窑”，简称“钧窑”，所产瓷器即名“钧瓷”。北宋灭亡后，钧窑停烧。随着钧窑工匠四处流散，钧瓷烧制技艺逐渐传布到各地。金元时期，江西、浙江、广东、山西等地都曾仿制过钧瓷，但由于原材料等因素，其艺术成就无法和宋代官窑制品相比。明清两代，钧瓷生产发展缓慢。新中国成立之后，钧瓷生产进入全面恢复时期。钧瓷世家任姓家族和卢姓家族的卢广东、卢广文等献出祖传绝技，为钧瓷的发展作出了贡献。　　钧瓷之所以名贵，除了造型浑厚端庄外，最突出的有两个方面：一是钧瓷在烧制中会出现窑变现象，含有铜质的釉料经窑变后会形成海棠红、朱砂红、鸡血红等釉色，彼此渗化，相映成辉，有“进窑一色，出窑万彩”之说;二是钧瓷制作工艺复杂，成品率低，一件钧瓷从选料到烧成需经过72道工序。　近年来，随着陶瓷行业机械化技术的推广及天然气炉、电炉的应用，传统的钧瓷烧制技艺日渐式微，钧瓷在文化内涵、艺术质量等方面均出现下降趋势，保护钧瓷传统烧制技艺已刻不容缓。 ",
