                    "details": "  重庆漆器髹饰技艺发展于秦汉，鼎盛于隋唐，延续至宋和明清时期，具有独特的地方风格。重庆漆器制作种类繁多，主要包括透明漆、黑推光漆、厚料漆、明光漆等各种髹饰技艺，产品可按用途分为生活、娱乐、装饰、旅游、收藏和兵器等六大类约数百个品种。其工艺复杂精巧，有制胎、髹漆、打磨等数十种，还有独创的研磨彩绘、蛋壳镶嵌、金银粉分光等特殊技法。重庆漆器产品曾出口到苏联和东欧等国家，并多次赴欧洲、美洲参加国际文化交流活动，还被当作国礼赠送给外国元首。北京故宫博物院、英国维多利亚博物馆、中国工艺美术馆等都收藏有重庆漆器作品。1954年以后，重庆漆器《金盘》、《蛋壳嵌凤盘》等多次荣获国际和国家级大奖。由于社会的发展变异，漆器产品渐渐淡出了人们的日常生活。加之重庆漆器髹饰技艺工艺复杂，工时长，成本高，经济效益不显著，目前这一古老的手工技艺已面临失传的危险，急需保护抢救。",
