                    "details": "德化瓷的制作兴于唐宋，盛于明清，技艺独特，至今传承未断。它一直是我国重要的对外贸易品，与丝绸、茶叶一道享誉世界，为制瓷技术的传播和中外文化交流作出了贡献。明代，德化瓷艺人何朝宗利用当地优质的高岭土，使用捏、塑、雕、刻、刮、接、贴等八种技法制作出精美的德化瓷塑，因艺术风格别致而被欧洲各国收藏。德化瓷因而被誉为“东方艺术珍宝”，在清代时出口欧洲。",
